import Stats from  "./Pages/stats"
import Stream from  "./Pages/stream"

function Home() {
  return (
    <div>
    <Link to={Stream} className="btn btn-primary">hello</Link> 
    <Link to={Stats} className="btn btn-primary">hello</Link> 
    </div>
  );
}

export default Home;
